import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Page404.module.css';

export default function Error() {
  return (
    <main className={classes.main__container}>
        <h3>ОШИБКА!!!</h3>
        <NavLink to='/'>
            <button>Go back</button>
        </NavLink>
    </main>
  );
}
